  return (
    <div className="App">
      <header className="App-header">
        <h1>Cookies</h1>
        <p>The most delecious cookies</p>
        <img className="cookies" src={image}></img>
        <div>
          <currentList />
        </div>
      </header>
    </div>
  );
}

export default App;
